OOF.Mesh.Scheduled_Output.Delete(mesh='swoops.png:skeleton:mesh', output='GraphicsUpdate<2>')
OOF.Graphics_1.Layer.New(category='Mesh', what='swoops.png:skeleton:mesh', how=FilledContourDisplay(when=latest,what=getOutput('Field:Component',component='',field=Temperature),where=getOutput('original'),min=automatic,max=automatic,levels=21,nbins=5,colormap=ThermalMap()))
OOF.Graphics_1.Toolbox.Pixel_Select.Clear(source='swoops.png:swoops.png')
OOF.Subproblem.Set_Solver(subproblem='swoops.png:skeleton:mesh:default', solver_mode=AdvancedSolverMode(time_stepper=UniformDriver(stepper=CrankNicolson(),stepsize=0.01),nonlinear_solver=NoNonlinearSolver(),symmetric_solver=ConjugateGradient(preconditioner=ICPreconditioner(),tolerance=1e-13,max_iterations=10000),asymmetric_solver=StabilizedBiConjugateGradient(preconditioner=ICPreconditioner(),tolerance=1e-13,max_iterations=1000)))
OOF.Mesh.Set_Field_Initializer(mesh='swoops.png:skeleton:mesh', field=Temperature, initializer=ConstScalarFieldInit(value=0))
OOF.Mesh.Solve(mesh='swoops.png:skeleton:mesh', endtime=1.0)
