OOF.Subproblem.Copy_Field_State(source='swoops.png:skeleton:mesh:default', target='swoops.png:skeleton:mesh2:default')
OOF.Subproblem.Copy_Equation_State(source='swoops.png:skeleton:mesh:default', target='swoops.png:skeleton:mesh2:default')
OOF.Mesh.Boundary_Conditions.Copy_All(current='swoops.png:skeleton:mesh', mesh='swoops.png:skeleton:mesh2')
